import React from "react";
import {Row, Col, Button } from 'reactstrap';
class CustomInputs extends React.Component{
    render(){
        return(
            <Row>
                <Col lg="6" md="6" sm="12" xs="12">
                    <Button color="primary" size="lg" block>Inputs <i class="fas fa-pen"></i></Button>
                </Col>
                <Col lg="6" md="6" sm="12" xs="12">
                    <Button color="primary" size="lg" block>Run <i class="fas fa-play"></i></Button>
                </Col>
                <Col lg="6" md="6"sm="12" xs="12">
                    <textarea className="input">Input goes here..</textarea>
                </Col>
                <Col lg="6" md="6"sm="12" xs="12">
                    <textarea className="output">Output goes here..</textarea>
                </Col>
            </Row>  
        );
    }
}
export default CustomInputs;
